import Hero from "../PrincipalSections/Hero"
import StepsSection from "../HomePage/StepsSection"

const HomePage = () => {
  return (
    <>
      <Header></Header>
      <main class="main">
        <Hero></Hero>
        <StepsSection></StepsSection>

      </main>
    </>
  );
};

export default HomePage;
